import React from "react";
import img1 from "../../assets/images/navbar/li-ning-small-nav.png";
const LogSignIn = () => {
  return (
    <>
      <div className="row sign-in">
        <div className="col-6 main-logo">
          {/* <a href="index.php"> */}
          <img
            onClick={() => {
              navigate("/");
            }}
            src={img1}
          />
          {/* </a> */}
        </div>
        <div className="col-6 sign-in-form">
          <div className="main-form">
            <div className="form-title">
              {/* <h1>Welcome Back</h1> */}
              <p>Welcome to Li-Ning Nepal ! Please Login.</p>
            </div>
            <div className="form-input">
              <label htmlFor="email">Email / Username</label>
              <br />
              <input type="email" />
              <br />
              <label htmlFor="password">Password</label>
              <br />
              <input type="password" />
              <br />
            </div>
            <div className="d-flex">
              <div className="remember-me">
                <input type="checkbox" />
                <label htmlFor="checkbox">Remeber Me</label>
              </div>
              <p>
                <a href="#">Forgot Password?</a>
              </p>
            </div>
            <button className="btn-1">Sign In</button>
            <p>
              Don't Have An Account? <a href="sign-up-page.html">Sign Up</a>
            </p>
          </div>
        </div>
      </div>
    </>
  );
};
export default LogSignIn;
